#JAMBALAYA (#Austin) SUNDAY (March 19) 

@pourchoicesaustin 12pm - 8pm #SXSW 

The Umbrella, Auxtails & Gravy, Saa Vaaj, & The Dope Academy have officially partnered and would like to announce our 2023 SXSW event “Jambalaya” Sunday March 19th. Located in the heart of the SXSW music festival at 401 E 6th Street Austin, Texas, Jambalaya is a mixture of the diverse elements of southern hip-hop. Independent artists, this is your opportunity to perform on the notorious 6th Street in Austin, Texas and grace the stage with some of the hottest entertainers of the 2023 SXSW Music Festival. You are cordially invited to “Jambalaya” powered by The Dope Academy. Text (404)889-6060 Now To Perform

@woodrow1k @mys_sk @thedopeacademy

